import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import HomePage from "./HomePage";
import ShoppingListApp from "./ShoppingListApp"; // Your main shopping list app component

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={HomePage} />
        <Route path="/lists" component={ShoppingListApp} />
        {/* Other routes for various parts of your app */}
      </Switch>
    </Router>
  );
}

export default App;
